import React, {Component} from 'react';
import './homepage.css';

import { Card, Button } from 'react-bootstrap';
class Homepage extends Component{

    render(){

      let count = 0;


      const { error, isLoaded, items } = this.props;
      console.log(this.props)
      if (error) {

        return <div>Error: {error.message}</div>;
      } else if (isLoaded) {

        return <div>Loading...</div>;
      } else {
        return (
          <div className="main" id="main">
            {/* <div> */}
                 {items.map((item) => (
                    <div className="card" key={item.flight_number}>
                        <img src={item.links.mission_patch_small} />
                        <div className="container">
                        <h4><b>{item.mission_name}</b></h4>
                        <h4>Mission Id: </h4><span>{item.mission_id}</span>
                        <h4>Launch Year: </h4><span>{item.launch_year}</span>
                        <h4>Successful Launch: </h4><span>{"" + item.launch_success}</span>
                        <h4>Successful Landing: </h4><span>{item.rocket.first_stage.cores[0].land_success === true ? "True" : "False"}</span>

                    </div>
                    </div>
                    // <Card style={{ width: '18rem' }}>
                    // <Card.Img variant="top" src={item.links.mission_patch_small}  />
                    // <Card.Body>
                    //     <Card.Title>{item.mission_name}</Card.Title>
